description:
Ed and Karen Parker move their family into a old Connecticut home to be near the hospital where their teenaged son receives cancer treatment. Soon after learning that their residence was once a funeral home, son Paul begins seeing entities and his health worsens. With his behavior becoming increasingly erratic, his parents have him committed to a mental hospital. Once the son is gone, the evil forces inhabiting the house turn on the rest of the family. In desperation, the Parkers contact psychic investigators Edward and Lorraine Warren for help.




